# Function to process each price detail dictionary
def process_price_detail(data_dict):
    # Extracting the list of prices with discounts
    prices_with_discount = [item["PriceWithDiscount"] for item in data_dict["Prices"]]

    # Summing the prices with discount
    sum_prices_with_discount = sum(prices_with_discount)

    # Extracting the total price from the summary
    total_price = data_dict["Summary"]["TotalPrice"]

    # Creating the list for comparison with variable names
    comparison_list = [("PriceWithDiscount", sum_prices_with_discount), ("TotalPrice", total_price)]

    # Comparing the values and determining if they are equal or not
    if sum_prices_with_discount == total_price:
        result = "Iguais"
    else:
        result = "Divergentes"

    return comparison_list, result

